import { createApp } from 'vue';

import App from './App.vue';

const routes = [
  { path: '/', component: 'App' }
];

const router = VueRouter.createRouter({
  history: VueRouter.createWebHashHistory(),
  routes
});

const app = Vue.createApp({});

app.use(router);
app.mount('#app');
